const MDF_FONT::SGlyphData* MDF_FONT::GetGlyphData(const unsigned int nCharcode)
{
    SGlyphData* result = nullptr;

    if (g_FontHeader.m_bASCII)
    {
        const unsigned int index = nCharcode - 32;

        if (index < g_FontHeader.m_nNumGlyphs)
        {
            result = &g_GlyphData[index];
        }
    }
    else
    {
        const unsigned int numGlyphs = g_FontHeader.m_nNumGlyphs;

        for (unsigned int i = 0; i < numGlyphs; ++i)
        {
            if (g_GlyphData[i].m_nCharcode == nCharcode)
            {
                result = &g_GlyphData[i];

                break;
            }
        }
    }

    return result;
}

void MDF_FONT::CalcBoundingBox(STextBoundingBox& TextBoundingBox, const char* pszString)
{
    if (!pszString || !*pszString)
    {
        TextBoundingBox.m_fMinX = 0.0f;
        TextBoundingBox.m_fMaxX = 0.0f;
        TextBoundingBox.m_fMinY = 0.0f;
        TextBoundingBox.m_fMaxY = 0.0f;

        return;
    }

    const char* currentCharPtr = pszString;
    bool isFirstCharacter = true;
    float minX = 0.0f;
    float maxX = 0.0f;
    float minY = 0.0f;
    float maxY = 0.0f;
    float accumulatedAdvance = 0.0f;
    float previousAdvance = 0.0f;
    const SGlyphData* lastGlyphData = nullptr;

    while (*currentCharPtr)
    {
        char currentChar = *currentCharPtr;
        const SGlyphData* glyphData = GetGlyphData(static_cast<unsigned int>(currentChar));

        if (glyphData)
        {
            if (isFirstCharacter)
            {
                minX = glyphData->m_afBearing[0];
                minY = glyphData->m_afBearing[1];
                isFirstCharacter = false;
            }

            accumulatedAdvance += previousAdvance;
            previousAdvance = glyphData->m_fAdvance;

            float glyphBottom = glyphData->m_afBearing[1] - glyphData->m_afSize[1];

            if (glyphBottom < minY)
            {
                minY = glyphBottom;
            }

            if (glyphData->m_afBearing[1] > maxY)
            {
                maxY = glyphData->m_afBearing[1];
            }

            lastGlyphData = glyphData;
        }

        ++currentCharPtr;
    }

    if (lastGlyphData)
    {
        accumulatedAdvance += lastGlyphData->m_afBearing[0] + lastGlyphData->m_afSize[0];
    }

    TextBoundingBox.m_fMinX = minX;
    TextBoundingBox.m_fMaxX = accumulatedAdvance;
    TextBoundingBox.m_fMinY = minY;
    TextBoundingBox.m_fMaxY = maxY;
}

void MDF_FONT::RenderQuad(unsigned int nCharcode, const float fScale, float& fPenX, const float fPenY, float* pVertices, float* pTexCoords)
{
    const MDF_FONT::SGlyphData* glyphData = GetGlyphData(nCharcode);

    if (!glyphData)
    {
        return;
    }

    const float positionX = (fScale * glyphData->m_afOffsets[0]) + fPenX;
    const float positionY = (fScale * glyphData->m_afOffsets[1]) + fPenY;

    //Bottom-left and top-left
    pVertices[0] = positionX;
    pVertices[1] = positionY;

    //Top-right and bottom-right
    pVertices[2] = positionX + fScale;
    pVertices[3] = positionY;

    //Bottom-right
    pVertices[4] = positionX + fScale;
    pVertices[5] = positionY + fScale;

    //Top-left
    pVertices[6] = positionX;
    pVertices[7] = positionY + fScale;

    pTexCoords[0] = glyphData->m_afTexU[0];
    pTexCoords[1] = glyphData->m_afTexV[1];
    pTexCoords[2] = glyphData->m_afTexU[1];
    pTexCoords[3] = glyphData->m_afTexV[1];
    pTexCoords[4] = glyphData->m_afTexU[1];
    pTexCoords[5] = glyphData->m_afTexV[0];
    pTexCoords[6] = glyphData->m_afTexU[0];
    pTexCoords[7] = glyphData->m_afTexV[0];

    fPenX += fScale * glyphData->m_fAdvance;
}

float MDF_FONT::ComputeLineHeightFromMetrics()
{
    float maxAscender = -FLT_MAX;
    float minDescender = FLT_MAX;

    for (unsigned int i = 0; i < g_FontHeader.m_nNumGlyphs; ++i)
    {
        const SGlyphData& glyph = g_GlyphData[i];

        const float ascender = glyph.m_afBearing[1];
        const float descender = glyph.m_afBearing[1] - glyph.m_afSize[1];

        if (ascender > maxAscender)
        {
            maxAscender = ascender;
        }

        if (descender < minDescender)
        {
            minDescender = descender;
        }
    }

    return maxAscender - minDescender;
}

float MDF_FONT::GetAdvanceWidth(unsigned int charcode)
{
    const MDF_FONT::SGlyphData* glyph = MDF_FONT::GetGlyphData(charcode);

    return glyph ? glyph->m_fAdvance : 0.f;
}
